import * as serviceWorker from '../serviceWorker';
import { subscribeUser } from '../subscription';

const Pushnotification = () => {
    serviceWorker.register();
    subscribeUser();
    console.log(process.env.REACT_APP_API_URL)
    return (
        <>
            Hello World!
        </>
    )
}
export default Pushnotification;
